import React, { Fragment, useEffect, useState } from 'react'
import axios from 'axios'
import { Table } from "react-bootstrap"  // Import Table from react-bootstrap
import Nav from './navbar'

function Profile() {
    const [data, Setprofiles] = useState([])

    useEffect(() => {
        axios.get("https://randomuser.me/api/?results=12")
            .then(res => Setprofiles(res.data.results))  // Use res.data.results to get the array of profiles
            .catch(err => console.log(err))

        // Cleanup function should be returned from useEffect
        return () => cleanup();
    }, []) 

    return (
        <Table striped bordered hover>  {/* Use Table component from react-bootstrap */}
            <thead>
                <tr className="table-primary">
                    <th scope="col">Name</th>
                    <th scope="col">Phone</th>
                    <th scope="col">Speed</th>
                    <th scope="col">Pop_name</th>
                    <th scope="col">Dslam_hostname</th>
                    <th scope="col">Frame</th>
                    <th scope="col">Attainable speed</th>
                </tr>
            </thead>
            <tbody>
                {data.map((user, index) => (
                    <tr key={index} className="table-light">
                        <td>{user.name.first} {user.name.last}</td>  {/* Access first and last name */}
                        <td>{user.phone}</td>
                        <td>{user.cell}</td>
                        <td>{user.location.city}</td>  {/* Access city from location */}
                        <td>{user.location.street.name}</td>  {/* Access street name from location */}
                        <td>{user.email}</td>
                        <td>{user.location.coordinates.latitude}</td>  {/* Access latitude from location */}
                    </tr>
                ))}
            </tbody>
        </Table>
    )
}

export default Profile

